public class Solution {
    public int findMaxLength(int[] nums) {
    	int ans = 0;
        int ozcnt = 0;
        Map<Integer,Integer> lookup = new HashMap<Integer,Integer>();
        lookup.put(0,-1);
        for(int i=0;i<nums.length;i++){
        	if(nums[i]==1){
        		ozcnt++;
        	}else{
        		ozcnt--;
        	}
        	if(lookup.containsKey(ozcnt)){
        		int rangelen = i-lookup.get(ozcnt);
        		if(rangelen>ans) ans = rangelen;
        	}else{
        		lookup.put(ozcnt,i);
        	}

        }
        return ans;
    }
}
